(function(Timeline){
	"use strict";
	
	if(!Timeline){
		throw new Error("Timeline Uninitialized");
	}
	
	function Fonts(obj){
		this.keyFontStyle = obj.keyFontStyle || "italic";
		this.keyFontSize = obj.keyFontSize || 14;
		this.keyFontFace = obj.keyFontFace || "sans-serif";
		this.keyTextColor = obj.keyTextColor || "#fff";
		
		this.titleFontStyle = obj.titleFontStyle || "italic";
		this.titleFontSize = obj.titleFontSize || 14;
		this.titleFontFace = obj.titleFontFace || "sans-serif";
		this.titleTextColor = obj.titleTextColor || "#ddd";
		
		this.segmentFontStyle = obj.segmentFontStyle || "";
		this.segmentFontSize = obj.segmentFontSize || 20;
		this.segmentFontFace = obj.segmentFontFace || "sans-serif";
		this.segmentTextColor = obj.segmentTextColor || "#000";
		
		this.idFontStyle = obj.idFontStyle || "italic";
		this.idFontSize = obj.idFontSize || 10;
		this.idFontFace = obj.idFontFace || "sans-serif";
		this.idTextColor = obj.idTextColor || "#ddd";
		
		Object.defineProperties(this,{
			keyFont: {get:function(){return this.keyFontStyle+" "+this.keyFontSize+"px "+this.keyFontFace;},enumerable:true},
			titleFont: {get:function(){return this.titleFontStyle+" "+this.titleFontSize+"px "+this.titleFontFace;},enumerable:true},
			segmentFont: {get:function(){return this.segmentFontStyle+" "+this.segmentFontSize+"px "+this.segmentFontFace;},enumerable:true},
			idFont: {get:function(){return this.idFontStyle+" "+this.idFontSize+"px "+this.idFontFace;},enumerable:true}
		});
		
		Object.freeze(this);
	}
	
	Timeline.Fonts = Fonts;
	
	function Colors(obj){
		this.bgMid = obj.bgMid || "#3e3f43";
		this.bgTop = obj.bgTop || "#292a2d";
		this.bgBottom = obj.bgBottom || "#292a2d";
		this.placeholder = obj.placeholder || "rgba(255, 255, 160, 0.5)";
		this.timeMarker = obj.timeMarker || "rgba(255, 255, 160, 0.5)";
		this.abRepeat = obj.abRepeat || "rgba(255, 0, 0, 0.4)";
		this.abRepeatLight = obj.abRepeatLight || "rgba(255, 0, 0, 0.25)";
		this.selectBox = obj.selectBox || "rgba(0, 119, 236, 0.25)";
		this.selectBorder = obj.selectBorder || "rgba(0, 128, 255, 0.25)";
		this.tintSaved = obj.tintSaved || "rgba(0,100,155,.1)";
		this.tintUnsaved = obj.tintUnsaved || "rgba(222,33,116,.15)";
		Object.freeze(this);
	}
	
	Timeline.Colors = Colors;
	
	function genImage(url){
		var img = new Image;
		img.src = url;
		return img;
	}
	
	var defaultImages = {
		// normal images
		segmentLeft: genImage("data:image/png;base64,"),
		segmentRight: genImage("data:image/png;base64,"),
		segmentMid: genImage("data:image/png;base64,"),
		// selected images
		segmentLeftSel: genImage("data:image/png;base64,"),
		segmentRightSel: genImage("data:image/png;base64,"),
		segmentMidSel: genImage("data:image/png;base64,"),
		// dark images
		segmentLeftDark: genImage("data:image/png;base64,"),
		segmentRightDark: genImage("data:image/png;base64,"),
		segmentMidDark: genImage("data:image/png;base64,"),
		// slider images
		sliderLeft: genImage("data:image/png;base64,"),
		sliderRight: genImage("data:image/png;base64,"),
		sliderMid: genImage("data:image/png;base64,"),
		// track images
		trackBg: genImage("data:image/png;base64,")
	};
	function Images(obj){
		var img, iname;
		for(iname in defaultImages){
			this[iname] = (obj[iname] instanceof Image)?obj[iname]:defaultImages[iname];
		}
	}
	
	Object.defineProperty(Images.prototype,'complete',{
		get: function(){
			var iname;
			for(iname in defaultImages){ if(!this[iname].complete){ return false; } }
			Object.defineProperty(this,'complete',{value:true});
			Object.freeze(this);
			return true;
		},enumerable:true
	});
	
	Timeline.Images = Images;
	
	function Cursors(obj){
		this.pointer = obj.pointer || "url(\"data:image/png;base64,\"), auto";
		this.order = obj.order || "url(\"data:image/png;base64,\") 15 15, ns-resize";
		this.resizeR = obj.resizeR || "url(\"data:image/png;base64,\") 10 15, col-resize";
		this.resizeL = obj.resizeL || "url(\"data:image/png;base64,\") 22 15, col-resize";
		this.move = obj.move || "url(\"data:image/png;base64,\") 15 15, ew-resize";
		this.skip = obj.skip || "url(\"data:image/png;base64,\") 1 5, auto";
		this.repeatA = obj.repeatA || "url(\"data:image/png;base64,\"), auto";
		this.repeatB = obj.repeatB || "url(\"data:image/png;base64,\"), auto";
		this.add = obj.add || "url(\"data:image/png;base64,\"), auto";
		this.select = obj.select || "url(\"data:image/png;base64,\"), auto";
		this.remove = obj.remove || "url(\"data:image/png;base64,\") 15 15, pointer";
		this.split = obj.split || "url(\"data:image/png;base64,\") 3 10, pointer";
		this.locked = obj.locked || "not-allowed";
		Object.freeze(this);
	}
	
	Timeline.Cursors = Cursors;
}(Timeline));